              SIGN IN
          </Link>
            <span className='nav-link'>
              SIGN OUT
            </span>

          {/* {currentUser ? (
            <span className='nav-link'>
              SIGN OUT
            </span>
          ) : (
            <Link className='nav-link' to='/auth'>
              SIGN IN
            </Link>
          )} */}
        </div>
      </div>
      <Outlet />
    </Fragment>
  );
};

export default Navbar;
